import * as React from 'react';
import Avatar from '@mui/material/Avatar';
import DialogTitle from '@mui/material/DialogTitle';
import Dialog from '@mui/material/Dialog';
import Box from '@mui/material/Box';
import Grid from '@mui/material/Grid';
import PhoneIcon from '@mui/icons-material/Phone';
import PhoneForwardedIcon from '@mui/icons-material/PhoneForwarded';
import EmailIcon from '@mui/icons-material/Email';
import WorkIcon from '@mui/icons-material/Work';
import EmployeeSchedule from '../Components/EmployeeSchedule'
import StarIcon from '@mui/icons-material/Star';

function AvatarImg(item) {
    if (item.job=="Ministro X")
        return (
            <Grid item xs={1} style={{display:"flex", alignItems:"center", justifyContent:"center"}}>
                <Avatar style={{ border: "solid orangeRed 3px" }} alt={item.name} src={`https://www.inf.ufpr.br/hvehrenfried/Treinamento/Dados/photo/${item['photo']}`} />
                <StarIcon style={{marginTop:"18px"}} />
            </Grid>
        )
        else return (
            <Grid item xs={1} style={{display:"flex", alignItems:"center", justifyContent:"center"}}>
                <Avatar style={{ border: "solid black 2px" }} alt={item.name} src={`https://www.inf.ufpr.br/hvehrenfried/Treinamento/Dados/photo/${item['photo']}`} />
            </Grid>
        )
}

export default function SimpleDialog(props) {
    const handleClose = () => {
        props.onClose();
    };

    return (
        <Dialog onClose={handleClose} open={props.open}>
            <DialogTitle>Informações Pessoais do Servidor</DialogTitle>
            <Box sx={{ flexGrow: 1, marginLeft: 2 }} style={{marginBottom:"16px"}}>
				<Grid container spacing={1}>
                    {AvatarImg(props.item)}
                    <Grid item xs={11} style={{display:"flex", alignItems:"center"}}>
                        <span>{props.item.name + " " + props.item.surname}</span>
                    </Grid>
                    <Grid item xs={1} style={{display:"flex", alignItems:"center", justifyContent:"center"}}>
                        <PhoneIcon fontSize='large' />
                    </Grid>
                    <Grid item xs={11} style={{display:"flex", alignItems:"center"}}>
                        <span>{props.item.phone}</span>
                    </Grid>
                    <Grid item xs={1} style={{display:"flex", alignItems:"center", justifyContent:"center"}}>
                        <PhoneForwardedIcon fontSize='large' />
                    </Grid>
                    <Grid item xs={11} style={{display:"flex", alignItems:"center"}}>
                        <span>{props.item.extension}</span>
                    </Grid>
                    <Grid item xs={1} style={{display:"flex", alignItems:"center", justifyContent:"center"}}>
                        <EmailIcon fontSize='large' />
                    </Grid>
                    <Grid item xs={11} style={{display:"flex", alignItems:"center"}}>
                        <span>{props.item.email}</span>
                    </Grid>
                    <Grid item xs={1} style={{display:"flex", alignItems:"center", justifyContent:"center"}}>
                        <WorkIcon fontSize='large' />
                    </Grid>
                    <Grid item xs={11} style={{display:"flex", alignItems:"center"}}>
                        <span>{props.item['job']}</span>
                    </Grid>
				</Grid>
                <EmployeeSchedule style={{margin: "50px"}} schedule={props.item.schedule} />
			</Box>
        </Dialog>
    );
}
